import React from "react";
import "../../Styles/Shared/MyButton.scss";

function MyButton({ name, className, icon, img, onClick }) {
  return (
    <button onClick={onClick} className={`${className} myButton`}>
      <img src={img} alt='' />
      {icon}
      {name}
    </button>
  );
}

export default MyButton;
